import React from 'react'

export default function SignUp() {
  return (
    <div>
      <p className='text-center mt-4'>Or Sign Up Using</p>
      <div className='d-flex align-items-center justify-contant-center'>
        <a href="javascript:void(0)"><i class="bi-facebook" role="img" aria-label="facebook"></i></a>
       <a href="javascript:void(0)"> <i class="bi-instagram" role="img" aria-label="instagram"></i></a>
       <a href="javascript:void(0)"> <i class="bi-google" role="img" aria-label="google"></i></a>
      </div>

    </div>
  )
}
